import React, { useState, useCallback, useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { Form, List, Button, Input} from 'antd';
import styled from 'styled-components';

const CenterDiv = styled.div`
    width: 70%;
    margin : 0 auto;
    margin-top: 20px;
`;

const CustomBtn = styled(Button)`
    margin-bottom: 5px;
`;
const CustomItem = styled(List.Item)`
    margin: 0;
    justify-content: center;
    padding: 0;CustomBtn
`;

const EditBucket = () => { 
    const dispatch = useDispatch();
    const [content, setContent] = useState('');
    const{ isLoggedIn} = useSelector((state) => state.user);
    const { bucket } = useSelector((state) => state.bucket);

    //Input
    const onContentChange = useCallback((e) => {
        setContent(e.target.value);
    }, [content]);

    //Add Buton
    const onAddClick = useCallback(() => {
        ;
    });



    return (
        <Form>
            <CenterDiv>
                <CustomBtn onClick={onAddClick}>추가</CustomBtn>
                <CustomBtn style={{float: 'right'}}>삭제</CustomBtn>
                <Input onChange={onContentChange} value={content} placeholder={'추가 또는 삭제하고싶은 버킷리스트를 입력하세요'} />
                <List
                style={{overflow: 'hidden'}}
                size="small"
                bordered
                dataSource={bucket}
                renderItem={item => <CustomItem>{item.content}</CustomItem>}
                />
            </CenterDiv>
        </Form>
    );
}

export default EditBucket;
